import React,{useState} from "react";
import Section from "./Component/Section";
import Player from "./Component/Player";
import "./App.css";



function App() {
  const [numlock, setNumlock] = useState('');
  const keyPress = (event) => {
    switch(event.key) {
      case '9' : 
        setNumlock(prev=> '9')
        break;
      case '8' : 
        setNumlock(prev=> '8')
        break;
      case '7' : 
        setNumlock(prev=> '7')
        break;
      case '6' :
        setNumlock(prev=> '6')
        break;
      case '5' : 
        setNumlock(prev=> '5')
        break;
        case '4' : 
        setNumlock(prev=> '4')
        break;
        case '3' : 
        setNumlock(prev=> '3')
        break;
        case '2' : 
        setNumlock(prev=> '2')
        break;
        case '5' : 
        setNumlock(prev=> '5')
        break;
      default: break;
    }
  }

  return (
    <div className='app' onKeyPress={(event) => keyPress(event)}>
      <Player></Player>
      <Section></Section>
    </div>
  );
}

export default App;
